import React from "react";
import { Table } from "reactstrap";
import axios from 'axios';
class CustomNavbar extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            books: []
        };
    }
    search=()=>{
        let books;
        axios.get('http://localhost:8080/api/V1/book')
            .then(function (data) {
            books=data;
            this.setState({
                books:books
            });
            });
    };
  render() {
    return (
      <div className="container">
        <Table bordered className="table-hover my-5">
          <thead>
            <tr className="table-info">
              <th>Sno</th>
              <th>Name</th>
              <th>ISBN</th>
              <th>Author</th>
              <th>Publisher</th>
              <th>Description</th>
              <th>Quantity</th>
              <th>Location</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <th scope="row">1</th>
              <td>Mark</td>
              <td>Otto</td>
              <td>@mdo</td>
              <td>Mark</td>
              <td>Otto</td>
              <td>@mdo</td>
              <td>fewf</td>
            </tr>
          </tbody>
        </Table>
      </div>
    );
  }
}
export default CustomNavbar;
